import 'bootstrap/dist/css/bootstrap.min.css';
import React, {Suspense} from 'react';
import './App.css';
import {connect, Provider} from "react-redux";
import {compose} from "redux";
import Main_wrapper from './components/main-wrapper/Mainwrap';
import Comentcontainer from './components/comment/comentcontainer';
import {Router, BrowserRouter, Route, withRouter} from "react-router-dom";
import UsersContainer from './components/users/UsersContainer';
import HeaderContainer from "./components/header/headerContainer";
import Login from "./components/login/login";
import {initializeApp} from "./redux/state/app-reducer";
import Loader from "./components/users/loader";
const ProfileContainer = React.lazy(() => import('./components/profile/ProfileContainer'));

class App extends React.Component {
    componentDidMount() {
        this.props.initializeApp();
    }

    render() {
        if (!this.props.initialized) {
            return <Loader />
        }
        return (
            <div>
                    <HeaderContainer/>
                    <Route path={"/main-wrapper"} render={() => <Main_wrapper/>}/>
                    <Route path={"/coment"} render={() => <Comentcontainer/>}/>
                <Route path={"/coment"} render={() => { return <Suspense fallback={<div>Загрузка...</div>}><ProfileContainer/></Suspense>}}/>
                    <Route path={"/users"} render={() => <UsersContainer/>}/>
                <Route path={"/profile/:userId?"} render={() => { return <Suspense fallback={<div>Загрузка...</div>}><ProfileContainer/></Suspense>}}/>
                    <Route path={"/login"} render={() => <Login/>}/>
            </div>
        );
    }
}
const mapStateToProps = (state) => ({
    initialized: state.app.initialized
})
export default compose(
    withRouter,
    connect(mapStateToProps, {initializeApp}))(App);
